import React from "react";
import Navbar from "./Navbar";
import Footer from "./Footer";
const Contact = () => {
  return (
    <div className="contact">
      <Navbar />
      <div className="contact_content">
        <h1>Contact Us</h1>
      </div>
      <Footer />
    </div>
  );
};

export default Contact;
